import React from "react";

import imgSrc from "../../resources/images/coming-soon.png";

const Component = info => {
  return (
    <div style={{ width: "100%" }}>
      <img
        alt="Coming Soon"
        src={imgSrc}
        style={
          info.colors[0] == "#f3f3f3"
            ? { width: "100%", filter: "invert(100%)" }
            : { width: "100%" }
        }
      />
    </div>
  );
};

export default Component;
